(5, 2, 0, 'SEJARAH & PROFIL SEKOLAH', 'sejarah-profil-sekolah', '<p>Identitas Sekolah</p>\n\n<p>Nama Sekolah          : SMKN 14 BANDUNG</p>\n\n<p>NPSN                        : 20219160</p>\n\n<p>Jenjang Pendidikan : SMK</p>\n\n<p>Status Sekolah         : Negeri</p>\n\n<p>Alamat Sekolah        : JL.CIJAWURA HILIR NO. 341</p>\n\n<p>RT / RW                    : 6 / 12</p>\n\n<p>Kode Pos                  : 40287</p>\n\n<p>Keluarahan               : Cijawura</p>\n\n<p>Kecamatan               : Buahbatu</p>\n\n<p>Kabupaten/Kota       : Bandung</p>\n\n<p>Provinsi                    : Jawa Barat</p>\n\n<p>Negara                      : Indonesia</p>\n\n<p>Posisi Geografis      : -6,9643 Lintang 107,6584 Bujur    </p>\n\n<p>2. Data Pelengkap                                </p>\n\n<p>SK Pendirian Sekolah        :   315/PU-071/DPU.KB/1986</p>\n\n<p>Tanggal SK Pendirian        :    1989-03-14</p>\n\n<p> Status Kepemilikan           :    Pemerintah Pusat           </p>\n\n<p> SK Izin Operasional          :    0135/0/1989</p>\n\n<p> Tgl SK Izin Operasional    :    1989-03-14               </p>\n\n<p>3. Kontak Sekolah                                </p>\n\n<p>Nomor Telepon    :    0227560358          </p>\n\n<p>Nomor Fax           :    0227505763 </p>\n\n<p>Email                    :    smk14bdg@yahoo.com</p>\n\n<p>Website                :     http://www.smkn14bdg.sch.id      </p>\n\n<p> </p>\n', 'https://www.smkn14bdg.sch.id/upload/1631867219.jpg', '-', 1, 3, '2019-12-16 21:15:04', '2021-09-17 00:00:00'),
(6, 2, 0, 'Visi & Misi', 'visi-misi', '<p><strong>Visi SMK Negeri 14 Bandung 2020-2030</strong></p>\n\n<p>Mewujudkan insan<em> </em>pembelajar yang berkarakter, berbudaya, dan profesional dalam bidang seni, desain dan teknologi di era industri 4.0 pada tahun 2030.</p>\n\n<p><strong>Nilai </strong><strong>SMK Negeri 14 Bandung </strong></p>\n\n<p>Unggul dalam prestasi, santun dalam perilaku</p>\n\n<p><strong>Misi SMK Negeri 14 Bandung </strong></p>\n\n<ol>\n <li>Menciptakan lingkungan sekolah yang sehat untuk mendukung optimasi kegiatan pembelajaran;</li>\n <li>Membentuk insan pembelajar berkarakter melalui penerapan sikap religius, kecerdasan sosial dan budaya literasi;</li>\n <li>Meningkatkan kesadaran berbudaya warga sekolah melalui pemenuhan sarana apresiasi dan ekspresi;</li>\n <li>Membangun profesionalisme melalui penerapan <em>teaching factory,</em> peningkatan mutu kemitraan dan pengembangan  Lembaga Sertifikasi Profesi;</li>\n <li>Mengembangkan ekosistem industri 4.0 melalui pemanfaatan teknologi informasi dan aksesibilitas terhadap internet.</li>\n</ol>\n\n<p><strong>       Tujuan SMK Negeri 14 Bandung </strong></p>\n\n<ol>\n <li>Melaksanakan 8 Standar Nasional Pendidikan;</li>\n <li>Melakukan penataan lingkungan yang sehat dan seimbang untuk kenyamaan warga sekolah;</li>\n <li>Mengembangkan program dan sarana literasi;</li>\n <li>Mengembangkan kesadaran religius dan kecerdasan sosial yang terintegrasi di dalam pembelajaran;</li>\n <li>Memenuhi sarana untuk peningkatan mutu kegiatan ekstrakurikuler, ekspresi dan apresiasi budaya;</li>\n <li>Mengembangkan model pembelajaran <em>teaching factory</em>, pemanfaatan kemitraan untuk memperkuat mutu keterserapan lulusan;</li>\n <li>Mendirikan Lembaga Sertifikasi Profesi (LSP-P1) yang berlisensi BSNP;</li>\n <li>Memenuhi sarana teknologi informasi dan aksesibilitas internet bagi warga sekolah di lingkungan sekolah;</li>\n <li>Mengembangkan pembelajaran kewirausahaan dalam era industri 4.0.</li>\n</ol>\n', 'https://www.smkn14bdg.sch.id/upload/1631867483.jpg', '-', 1, 3, '2019-12-16 21:17:42', '2021-09-17 00:00:00'),
(7, 2, 0, 'Budaya & Logo', 'budaya-logo', '<h2><strong>Konsep Bentuk</strong></h2>\n\n<p>Bentuk dasar logo SMKN 14 Bandung, berasal dari burung cenderawasih yang mengepakan sayapnya yang merupakan cerminan dari pengembangan.</p>\n\n<h2><strong>Konsep Typografi</strong></h2>\n\n<p>Jenis huruf : Tahoma Bold mencerminkan tekhnologi</p>\n\n<h2><strong>Konsep Warna</strong></h2>\n\n<p>Biru Tua mencerminkan tekhnologi</p>\n\n<p>Biru Muda merupakan visualisasi langit atau ruang yang luas yang mencerminkan era globalisas</p>\n', 'https://www.smkn14bdg.sch.id/upload/1630589513.jpg', '-', 1, 3, '2019-12-16 21:19:06', '2021-09-02 00:00:00'),
(8, 2, 0, 'Landasan Hukum SMK', 'landasan-hukum-smk', '<p>secara yuridis Kurikulum SMK  dikembangkan berdasarkan  landasan yaitu:</p>\r\n\r\n<p>·Undang-undang Dasar 1945 Pasal 31 ayat (5), “Pemerintah memajukan ilmu pengetahuan dan teknologi dengan menjunjung tinggi nilai-nilai agama dan persatuan bangsa untuk kemajuan peradaban serta kesejahteraan umat manusia”  dan Pasal 32 ayat (1), “Negara memajukan kebudayaan nasional Indonesia di</p>\r\n\r\n<p> </p>\r\n\r\n<p>secara yuridis Kurikulum SMK  dikembangkan berdasarkan  landasan yaitu:</p>\r\n\r\n<p>·Undang-undang Dasar 1945 Pasal 31 ayat (5), “Pemerintah memajukan ilmu pengetahuan dan teknologi dengan menjunjung tinggi nilai-nilai agama dan persatuan bangsa untuk kemajuan peradaban serta kesejahteraan umat manusia”  dan Pasal 32 ayat (1), “Negara memajukan kebudayaan nasional Indonesia di tengah peradaban dunia dengan menjamin kebebasan masyarakat dalam memelihara dalam mengembangkan nilai-nilai budayanya.”</p>\r\n\r\n<p>·Undang-undang Nomor 20 Tahun 2003 tentang Sistem Pendidikan Nasional Bab II Pasal 3, ”Pendidikan bertujuan untuk mengembangkan potensi peserta didik seutuhnya agar menjadi manusia yang beriman dan bertakwa kepada Tuhan Yang Maha Esa, berakhlak mulia, sehat, berilmu, cakap, kreatif, mandiri, dan menjadi warga negara yang demokratis serta bertanggung jawab”. Pasal 36 ayat (2), “Kurikulum pada semua jenjang dan jenis pendidikan dengan prinsip diversifikasi sesuai dengan satuan pendidikan, potensi daerah, dan peserta didik”. Pasal 38 ayat (2), “Kurikulum pendidikan dasar dan menengah dikembangkan sesuai dengan relevansinya oleh setiap kelompok atau satuan pendidikan dan komite sekolah/madrasah di bawah koordinasi dan supervisi dinas pendidikan atau kantor departemen agama kabupaten/kota untuk pendidikan dasar dan provinsi untuk pendidikan menengah”.</p>\r\n\r\n<p>·Peraturan Pemerintah Nomor 19 Tahun 2005 tentang Sistem Pendidikan Nasional Pasal 17 ayat (1), “Kurikulum Tingkat Satuan Pendidikan SD/MI/SDLB, SMP/MTs./SMPLB, SMA/MA/SMALB/SMK/MAK, atau bentuk lain yang sederajat dikembangkan sesuai dengan satuan pendidikan, potensi daerah/karakteristik daerah, sosial budaya masyarakat setempat, peserta didik”.</p>\r\n\r\n<p>·Peraturan Menteri Pendidikan Nasional nomor 6 Tahun 2011 tentang Perubahan Peraturan Menteri Pendidikan Nasional dan nomor 24 Tahun 2006 tentang pelaksanaan Standar Isi dan Standar Kompetensi Lulusan, “Satuan pendidikan dapat mengadopsi atau mengadaptasi model Kurikulum Tingkat Satuan Pedidikan Dasar dan Menengah yang disusun oleh Badan Penelitian dan Pengembangan Departemen Pendidikan Nasional bersama unit terkait”.</p>\r\n\r\n<p>·Permendiknas N0. 41 Tahun 2007 tentang Standar Proses.</p>\r\n\r\n<p>·Permendiknas No. 20 Tahun 2007 tentang Standar Penilaian.</p>\r\n\r\n<p>·Peraturan Pemerintah RI Nomor 32 tahun 2013 tentang Perubahan atas peraturan pemerintah nomor 19 tahun 2005 tentang Standar Nasional Pendidikan.</p>\r\n\r\n<p>·Peraturan Menteri Pendidikan dan Kebudayaan RI Nomor 54 tahun 2013 tentang Standar Kompetensi Lulusan Pendidikan Dasar dan Menengah .</p>\r\n\r\n<p>·Peraturan Menteri Pendidikan dan Kebudayaan RI Nomor 64 Tahun 2013 tentang Standar Isi.</p>\r\n\r\n<p>·Peraturan Menteri Pendidikan dan Kebudayaan RI Nomor 65 Tahun 2013 tentang Standar Proses.</p>\r\n\r\n<p>·Peraturan Menteri Pendidikan dan Kebudayaan RI Nomor 66 Tahun 2013 tentang Standar Penilaian.</p>\r\n\r\n<p>·Peraturan Menteri Pendidikan dan Kebudayaan RI Nomor 69Tahun 2013 tentang Kerangka Dasar Kurikulum SMA/MA.</p>\r\n\r\n<p>·Peraturan Menteri Pendidikan dan Kebudayaan RI Nomor 71Tahun 2013 tentang Buku Teks Pelajaran Layak. </p>\r\n\r\n<p>Permendikbud 81 A tentang Pedoman Implementasi Kurikulum </p>\r\n', 'https://www.smkn14bdg.sch.id/upload/1632045619.png', '-', 1, 3, '2019-12-16 21:20:31', '2021-09-19 00:00:00'),
(67, 2, 8, 'Enam Bulan yang Berharga ', 'enam-bulan-yang-berharga', '<p>Sebanyak 535 siswa SMKN 14 Bandung melaksanakan Praktik Kerja Lapangan (PKL) selama enam bulan di industri maupun di sekolah.  PKL pada tahun 2021 dimulai pada bulan April dan diakhiri pada bulan September 2021.  Meskipun masih dibatasi PPKM pelaksanaan PKL berjalan lancar dengan berbagai model.   Beberapa Kompetensi Keahlian melaksanakan PKL di sekolah dengan bekerjasama dengan pihak DUDIKA.  Seperti siswa dari Kompetensi Keahlian Desain Komunikasi Visual yang PKL di Technopark, pekerjaannya dipantau dan dibimbing oleh PT. Bismi Desain Konsultan.  Begitu juga dengan siswa dari Kompetensi Keahlian Logam dan perhiasan mereka mengerjakan proyek dari Runa Jewellery di bengkel Komli Logam di sekolah.  </p>\r\n\r\n<p>Industri yang menerima siswa SMKN untuk melakukan PKL bukan hanya di dalam kota Bandung, tapi juga di luar kota Bandung seperti di Tasikmalaya dan Slawi.  Bermacam industri dan dunia kerja dimasuki siswa saat melaksanakan PKL.  Beberapa diantara dunia kerja yang menerima siswa PKL seperti Kantor Kelurahan, Dinas-dinas dan Badan-badan negara.  Namun kebanyakan siswa melakukan PKL di industri yang sudah menjadi rekanan SMKN 14 Bandung.  Salah satu siswa yang melakukan PKL di sekolah adalah Mia kelas XII Logam 1, saat diwawancara Mia mengaku senang bisa melakukan PKL di sekolah selama 6 bulan dengan pengaturan jadwal dan selalu memperhatikan protokol kesehatan saat bekerja di Bengkel.  Selain dari pihak Runa Jewellery, Mia pun dibimbing oleh guru-guru di Komli Logam dan Perhiasan seperti Pak Joko Maryanto, Ibu Detin dan Pak Dede Rahmat.   Mia pun berpendapat bahwa PKL untuk siswa SMK itu sangat penting karena PKL bisa memberi gambaran saat nanti bekerja di industri setelah lulus.  Siti dari XII Logam 1 pun berpendapat sama.  Senang bisa PKL walaupun terpotong waktu saat pemberlakuan PPKM, tapi ilmu dan keterampilan saat PKL bisa tetap didapatkan para siswa kelas XII.  Lain halnya dengan Hanifah kelas  XII MM 4 dan Fadiya kelas XII TBO 1 yang melakukan PKL di industri.  Hanifah  bersama 7 orang temannya dari    </p>\r\n\r\n<p>Kompetensi keahlian Multimedia melakukan PKL di Ferula Wedding organizer.  Mereka mendapat kesempatan untuk mengerjakan proyek pemotretan pre wedding sampai meliput acara pernikahan secara bergiliran.  Fadiya melakukan PKL di PT NJS yang sudah menjadi rekanan SMKN 14 mendapat keterampilan di bidang car painting sekaligus ilmu wirausaha dari PT NJS.  Keduanya pun berpendapat bahwa Praktik Kerja Lapangan sangat penting dan membawa banyak manfaat untuk siswa.   Selama enam bulan bekerja di sebuah industri bermodalkan ilmu dan keterampilan yang telah dipelajari selama kelas X dan XI akan sangat menantang dan membuat siswa menjadi lebih dewasa.  Disiplin yang berlaku di dunia kerja dan industri bisa sangat berbeda dengan peraturan di sekolah.   Saat nanti tiba waktunya kelas X dan XI masuk ke dunia kerja sebagai siswa PKL, bersyukurlah atas kesempatan kalian bisa bergabung di  industri tersebut.   Ikuti semua tata cara dan tata pergaulan di tempat baru.  Selalu  melakukan kontak dengan pembimbing sekolah agar kalian terpantau saat jauh dari sekolah.         </p>\r\n\r\n<p>Jika ada yang bertanya, apakah  PKL berpengaruh pada nilai raport? Maka Jawabannya adalah nilai PKL sangat penting untuk menentukan kelulusan siswa.  Mengapa demikian? Karena lulusan SMK saat lulus akan dilihat dari dua titik.  Pertama dimana dia melakukan PKL dan bagaimana hasil PKL-nya.  Hal ini akan ditunjukkan dengan sertifikat PKL yang ditandatangani pihak industri.  Kedua, bagaiman penguasaan kompetensi keahlian setiap siswa yang dibuktikan dengan nilai Ujian Kompetensi Keahlian.  Jadi, secara pengalaman PKL sangat bermanfaat.  Begitu pula sebagai pencapaian selama belajar di SMK.    Siap belajar di industri selama 6 bulan?  Harus siap!  Sampaikan artikel ini pada orang tua kalian kelas X dan XI agar mereka mendukung program sekolah dan menjadikan kalian siswa SMK yang lengkap seperti yang diharapkan.  Enam bulan tidak akan terasa lama jika hati dan pikiran terfokus mendapatkan manfaat besar dari Praktik Kerja Lapangan.</p>\r\n\r\n<p>R. Ruvianty</p>\r\n\r\n<p>Tim Redaksi SMKN 14 Bandung</p>\r\n', 'https://www.smkn14bdg.sch.id/upload/1633398961.jpg', '', 1, 1, '2021-10-05 08:41:56', '2021-10-05 00:00:00'),
(13, 2, 0, 'Osis', 'osis', '<p><strong>OSIS</strong> (Organisasi Siswa Intra Sekolah) merupakan satu-satunya organisasi kesiswaan yang berada di lingkungan sekolah. <strong>Tujuan</strong> didirikannya <strong>OSIS</strong> adalah untuk melatih siswa dalam berorganisasi dengan baik dan menjalankan kegiatan sekolah yang berhubungan dengan siswa.</p>\r\n', 'https://www.smkn14bdg.sch.id/upload/1611222229.jpg', '-', 1, 3, '2019-12-18 22:45:52', '2021-09-19 00:00:00'),
