(64, 2, 4, 'Contoh Konten Lowongan Pekerjaam', 'contoh-konten-lowongan-pekerjaam', '<p>www.azrahstore.com<br>\r\nMembutuhkan Graphic Designer<br>\r\n<br>\r\nSyarat khusus lainnya:<br>\r\nFamiliar dengan Sosial Media : Facebook, Instagram dan Tiktok</p>\r\n', 'https://www.smkn14bdg.sch.id/upload/1632066296.png', '-', 1, 2, '2021-09-19 22:43:50', '2021-09-19 00:00:00'),
(65, 2, 8, 'Media Sekolah', 'media-sekolah', '<p><strong>MEDIA SEKOLAH</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p>Oleh: Bambang Subarnas</p>\r\n\r\n<p>Keberadaan media publikasi bagi sekolah, kini sudah menjadi sebuah keniscayaan. Betapa tidak, mengakses informasi dimasa kini sudah menjadi budaya dan perilaku keseharian masyarakat, baik dewasa maupun anak-anak. Keberadaan media sekolah, terutama media digital baik <em>website</em> maupun media sosial menjadi sarana untuk pembelajaran, membangun citra (<em>brand)</em>, mengkomunikasikan produk, membangun kemitraan agar terjadi kolaborasi dengan dunia luar. Sarana untuk itu semua kini tersedia luas, menjadikan kinerja menjadi lebih efektif dan efisien.  Data-data dapat disimpan di cloud, pengetahuan dan informasi dapat diproduksi untuk di-<em>share</em> ke tengah publik. Pendek kata, inilah revolusi industri 4.0 yang akan terus bergerak ke era digitalize dan dunia virtual yang semakin paripurna.</p>\r\n\r\n<p>Keberadaan media SMKN 14 Bandung ini merupakan bagian dari perwujudan visi sekolah, yaitu Menciptakan insan pembelajar yang kreatif, berbudaya, dan berkarakter dalam bidang seni, desain, dan teknologi pada era endustri 4.0 pada tahun 2030. Harapannya, secara bertahap dapat terbangun ekosistem industri 4.0 di SMKN 14 Bandung.</p>\r\n\r\n<p>Media ini dikelola oleh sebuah unit dengan prinsip penerbitan (publishing). Didalam unit terdapat tim redaksi, reporter, tim desain, tim pemrogaman komputer. Demikian pula updating informasi dilakukan secara edisional setiap 2 minggu. Sumber sumber informasi dapat diperoleh bukan hanya dari internal sekolah tetapi juga dari luar sekolah, seperti alumni, orang tua, atau isu isu aktual yang dipandang relevan untuk diangkat di media sekolah ini.</p>\r\n\r\n<p>Pada hari ini media SMKN 14 Bandung kami <em>launching</em>. Barangkali masih bibit. Seperti juga pohon yang tumbuh berproses, bercabang, rimbun, berbunga dan berbuah, media SMKN 14 inipun akan terus bertumbuh semakin lengkap dan baik memasuki dunia yang lebih terbuka, dan berkolaborasi dengan berbagai pihak, memenuhi harapan pendidikan yang bermutu dan para siswa yang siap untuk memasuki dunia kerja, dan mengembangkan diri sebagai insan pembelajar sepanjang hayat. Semoga.</p>\r\n\r\n<p>Bambang Subarnas, M.Sn.</p>\r\n\r\n<p><strong>MEDIA SEKOLAH</strong></p>\r\n\r\n<p> </p>\r\n\r\n<p>Oleh: Bambang Subarnas</p>\r\n\r\n<p>Keberadaan media publikasi bagi sekolah, kini sudah menjadi sebuah keniscayaan. Betapa tidak, mengakses informasi dimasa kini sudah menjadi budaya dan perilaku keseharian masyarakat, baik dewasa maupun anak-anak. Keberadaan media sekolah, terutama media digital baik <em>website</em> maupun media sosial menjadi sarana untuk pembelajaran, membangun citra (<em>brand)</em>, mengkomunikasikan produk, membangun kemitraan agar terjadi kolaborasi dengan dunia luar. Sarana untuk itu semua kini tersedia luas, menjadikan kinerja menjadi lebih efektif dan efisien.  Data-data dapat disimpan di cloud, pengetahuan dan informasi dapat diproduksi untuk di-<em>share</em> ke tengah publik. Pendek kata, inilah revolusi industri 4.0 yang akan terus bergerak ke era digitalize dan dunia virtual yang semakin paripurna.</p>\r\n\r\n<p>Keberadaan media SMKN 14 Bandung ini merupakan bagian dari perwujudan visi sekolah, yaitu Menciptakan insan pembelajar yang kreatif, berbudaya, dan berkarakter dalam bidang seni, desain, dan teknologi pada era endustri 4.0 pada tahun 2030. Harapannya, secara bertahap dapat terbangun ekosistem industri 4.0 di SMKN 14 Bandung.</p>\r\n\r\n<p>Media ini dikelola oleh sebuah unit dengan prinsip penerbitan (publishing). Didalam unit terdapat tim redaksi, reporter, tim desain, tim pemrogaman komputer. Demikian pula updating informasi dilakukan secara edisional setiap 2 minggu. Sumber sumber informasi dapat diperoleh bukan hanya dari internal sekolah tetapi juga dari luar sekolah, seperti alumni, orang tua, atau isu isu aktual yang dipandang relevan untuk diangkat di media sekolah ini.</p>\r\n\r\n<p>Pada hari ini media SMKN 14 Bandung kami <em>launching</em>. Barangkali masih bibit. Seperti juga pohon yang tumbuh berproses, bercabang, rimbun, berbunga dan berbuah, media SMKN 14 inipun akan terus bertumbuh semakin lengkap dan baik memasuki dunia yang lebih terbuka, dan berkolaborasi dengan berbagai pihak, memenuhi harapan pendidikan yang bermutu dan para siswa yang siap untuk memasuki dunia kerja, dan mengembangkan diri sebagai insan pembelajar sepanjang hayat. Semoga.</p>\r\n\r\n<p>Bambang Subarnas, M.Sn.</p>\r\n', 'https://www.smkn14bdg.sch.id/upload/1633397476.jpg', '', 1, 1, '2021-09-20 10:29:14', '2021-10-05 00:00:00'),
(66, 2, 9, 'AKU BEKERJA MAKA AKU ADA \"OPINI  Si Bung\" ', 'aku-bekerja-maka-aku-ada-opini-si-bung', '<p>  Salah satu ukuran keberhasilan pendidikan     SMK     adalah     keterserapan lulusannya di dunia kerja. Jargon BMW (Bekerja Melanjutkan Wirausaha) telah menjadi jargon seluruh SMK di Indonesia. Beragam konsep program diluncurkan oleh  Kementrian Pendidikan, Kebudayaan, Riset, dan Teknologi RI untuk mewujudkan jargon tersebut, seperti  link and match, Unit Produksi, Teaching factory (TEFA), PKL (Praktek Kerja Lapangan), kemitraan sekolah dengan DUDIKA (Dunia Usaha Dunia Industri dan Dunia Kerja).  </p>\r\n\r\n<p>“SMK sebagai pemasok tenaga  kerja,” bunyi salah satu latar belakang program roadmap pengembangan SMK  2021. Di  balik program-program tersebut  kita dapat membacanya sebagai  pentingnya warga negara memiliki pekerjaan. Kerja, bagi manusia memiliki makna eksistensial, karena merupakan aktifitas pembeda antara manusia dengan hewan. Hewan untuk mempertahankan hidupnya berdasarkan insting atau naluri, yaitu pola perilaku dan respon bawaan (kodrati) secara turun temurun terhadap lingkungan sekitar tanpa dipelajari.  Cara bertahan hidup seekor kerbau sejak dulu tak pernah berubah hingga hari ini. Desain tubuhnya dilengkapi dengan perangkat pertahanan yang memungkinkan seekor kerbau “lestari” hingga hari ini. Sementara  manusia, membutuhkan waktu untuk  belajar dalam mempertahankan hidupnya. Kelengkapan tubuhnya tidak didesain untuk bisa bertahan secara langsung dari tantangan lingkungan sekita. Ia butuh pengasuhan, butuh belajar dari generasi sebelumnya     sehingga     hidupnya     tidak hanya     mengandalkan     naluri,     tetapi  berdasarkan     akal     yang     tercerdaskan melalui     proses     pengasuhan     dan pembelajaran sepanjang hidupnya. Daya rasional     dalam     aktifitas     kognitifnya, membuat manusia mengerti dan kemudian mendorong manusia untuk melakukan aktifitas     yang     mengatasi     dorongandorongan nalurinya. Bekerja bagi manusia adalah tindakan tercerahkan, rasional, dan kultural, bagi keberlangsungan hidupnya. Secara sosial, bekerja menjadi sarana perwujudan diri, keberhargaan diri bagi seseorang.     Faktanya     kita     melihat  masyarakat secara umum menempatkan status     sosial     seseorang     berdasarkan pekerjaannya.   “Aku ini apa? Aku sebagai apa?” menjadi     dialog     terdalam     pada     diri seseorang.  Maka secara sosial eksistensi manusia ada pada makna kerja, “Aku bekerja, maka aku ada!”  PKL (Praktek Kerja Lapangan) yang dilaksanakan SMKN 14 selama  satu semester     dari     bulan     April     hingga September 2021, bukan hanya program kurikulum, lebih dari itu kita tengah mengangkat harkat dan martabat manusia. </p>\r\n\r\n<p>(Bambang Subarnas)</p>\r\n\r\n<p>Tim Redaksi SMKN 14 Bandung</p>\r\n', 'https://www.smkn14bdg.sch.id/upload/1633397719.jpg', '', 1, 1, '2021-10-05 08:35:19', '2021-10-05 08:35:19'),
(63, 2, 7, 'Kunjungan Pengawas Baru ke SMKN 14 Kota Bandung', 'kunjungan-pengawas-baru-ke-smkn-14-kota-bandung', '<p><strong>Bandung</strong> - SMKN 14 Kota Bandung atau yang dulu dikenal dengan SMSR (Sekolah Menengah Seni Rupa) mempunyai segudang prestasi baik akademik maupun non-akademik. SMKN 14 Bandung terkenal dengan karya-karya siswa-siswanya yang sudah memiliki daya jual tinggi, salah satunya karya batik dari Kompetensi Keahlian Kriya Kreatif Tekstil dan Batik. Juga produk bet tenis meja karya Kompetensi Keahlian Kayu dan Rotan yang menjadi produk unggulan TEFA SMKN 14. Beberapa karya batik pernah menjuarai Lomba Keterampilan Siswa tingkat kota, provinsi, hingga tingkat nasional.</p>\n\n<p>Pada hari Kamis 19 Agustus 2021 lalu SMKN 14 Kota Bandung berkesempatan untuk menerima kunjungan dari pengawas baru, Ibu S. Ety Meiningsih, S,Pd., M.M.Pd. atau biasa disapa dengan Ibu Mei. Ibu Mei sangat mengapresiasi karya-karya yang dihasilkan oleh siswa-siswi SMKN 14 Bandung, salah satunya batik tulis dengan motif Jawa Barat dan cenderamata yang terbuat dari kayu serta di dalamnya terdapat sebuah cincin hasil karya siswa Kompetensi Keahlian  kriya logam dan perhiasan.</p>\n\n<p>“Harapan saya untuk seluruh peserta didik di SMKN 14 Kota Bandung yang milenial ini, memiliki sumber daya tangguh yang bersemangat, dan membaca peluang pada zaman ini, yang dihasilkan untuk berdaya saing dan bermanfaat buat produk Indonesia,\" tuturnya pada sesi wawancara.</p>\n\n<p>“Harapan kami untuk ke depannya SMKN 14 Kota Bandung akan mengembangkan wirausaha <em>New Teaching Factory</em>, salah satunya produk Seni dan Teknologi, semoga menjadi inspirasi untuk sekolah lainya,” tutupnya.</p>\n\n<p>Sebelumnya Ibu Mei sempat berkeliling SMKN 14 Kota Bandung dan berkunjung ke beberapa bengkel,. Mulai dari bengkel kriya tekstil, kriya keramik, kriya kulit, kriya logam kriya kayu, dan Techno Park. Setelah ke beberapa bengkel beliau pun berkunjung ke Studio DKV, Studio Animasi dan Studio Multimedia.</p>\n\n<p>Beberapa harapan buat ke depannya, Bu Mei  ingin membuat SMKN 14 Kota Bandung menjadi sekolah unggulan yang mempunyai daya saing dengan sekolah lain, khsusnya SMK se-Indonesia supaya menjadi salah satu SMK yang membuat hasil karya kreatif dan mempunyai daya jual tinggi, dan menjadikan lulusannya sumber daya manusia yang unggul dalam prestasi santun dalam sikap perlaku juga bedaya saing.tinggi<strong>(<em>Red</em>)…</strong></p>\n\n<p>Arif Nugraha - SMKN 14 Publishing</p>\n\n<p> </p>\n', 'https://www.smkn14bdg.sch.id/upload/1630290552.jpg', '', 1, 1, '2021-08-30 09:27:15', '2021-08-30 00:00:00');
INSERT INTO `tbl_berita` (`id`, `id_member`, `id_category`, `title`, `slug`, `content`, `image`, `tags`, `status`, `type`, `created_at`, `updated_at`) VALUES
(68, 2, 8, 'Urgensi PKL di SMK ', 'urgensi-pkl-di-smk', '<p>Mengapa kegiatan PKL ini menjadi penting di SMK?     Karena     telah banyak isu yang beredar di     masyarakat     bahwa penyumbang     tertinggi angka     pengangguran justru     lulusan     SMK. Lulusan SMK, alih alih  bisa     mengisi     peluang kerja     di     dunia  usaha/dunia industri, malah justru menjadi tidak hebat  dalam unjuk kompetensi di dunia usaha/dunia industri.   Karena itulah dalam Link and Match 8+i, PKL menjadi salah satu  aspek keterlibatan dunia kerja dalam penyelenggaraan pendidikan vokasi. </p>\r\n\r\n<p>Jargon  “link and match” yang secara harfiah dapat diartikan sebagai kondisi adanya keterkaitan dan keselarasan antara dunia kerja dengan SMK, dan telah sangat lama     didengungkan     di     komunitas pendidikan khususnya SMK.  Akhir akhir ini jargon yang sangat populer itu berubah menjadi  Link and Match 8+i. Semua itu karena terdapat 8 aspek keterlibatan dunia kerja dalam penyelenggaraan pendidikan vokasi ditambah berbagai kemungkinan kerja sama yang dapat dilakukan dengan dunia kerja (i). </p>\r\n\r\n<p>Dengan demikian, adanya PKL yang terlaksana secara baik diupayakan akan mampu mengahapus stigma buruk tentang SMK, dan pada akhirnya akan   mampu membalik keadaan dimana lulusan SMK harus menjadi “Bisa mengisi peluang kerja dan Hebat dalam unjuk kompetensi di tempat kerjanya”, SMK Bisa Hebat.  Mengapa demikian? karena dengan  PKL Siswa diharapkan dapat: (1) merasakan langsung pembelajaran praktik di dunia kerja; (2) memperoleh pengalaman etos kerja; (3) mengetahui lingkungan kerja yang sebenarnya; (4) mengetahui proses kinerja yang terdapat di perusahaan (produk, tenaga kerja, kedisiplinan dan keselamatan kerja); (5) membandingkan ilmu dan keterampilan yang diperoleh di sekolah dengan pelaksanaan di industri; (6) memperoleh</p>\r\n\r\n<p>Subandi (Hubin/mas SMKN 14 Bandung)</p>\r\n\r\n<p>editorial : R. Ruvianty</p>\r\n\r\n<p>Tim Redaksi SMKN 14 Bandung</p>\r\n', 'https://www.smkn14bdg.sch.id/upload/1633398930.jpg', '', 1, 1, '2021-10-05 08:46:43', '2021-10-05 00:00:00');
