(4, 'Desain Komunikasi Visual', 'desain-komunikasi-visual', '<table cellspacing=\"0\" xss=removed>\r\n <tbody>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p><strong>MATA PELAJARAN</strong></p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p><strong>A. Muatan Nasional</strong></p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>1. Pendidikan Agama dan Budi Pekerti</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>2. Pendidikan Pancasila dan Kewarganegaraan</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>3. Bahasa Indonesia</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>4. Matematika</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>5. Sejarah Indonesia</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>6. Bahasa Inggris dan Bahasa Asing Lainnya</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p><strong>B. Muatan Kewilayahan</strong></p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>1. Seni Budaya</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>2. Pendidikan Jasmani, Olahraga dan Kesehatan</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p><strong>C. Muatan Peminatan Kejuruan</strong></p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p><strong>C1. Dasar Bidang Keahlian</strong></p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>1. Simulasi dan Komunikasi Digital</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>2. Tinjauan Seni</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>3. Dasar-dasar Kreativitas</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p><strong>C2. Dasar Program Keahlian</strong></p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>1. Dasar-dasar Seni Rupa</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>2. Gambar</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>3. Sketsa</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p><strong>C3. Kompetensi Keahlian </strong></p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>1. Desain Publikasi</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>2. Komputer Grafis</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>3. Fotografi</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>4. Videografi</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td xss=removed>\r\n   <p>5. Produk Kreatif dan Kewirausahaan</p>\r\n   </td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030253.jpg', 'https://smkn14bdg.sch.id/upload/1609292980.png', '2020-01-09 03:10:03', '2021-09-19 00:00:00'),
(5, 'Animasi', 'animasi', '<ul>\n <li><strong>Kompetensi Keahlian Animasi pertama kali menjadi bagian SMKN 14 Bandung pada tahun 2015 di kelompok Program Keahlian Seni Rupa.  Kompetensi Keahlian Animasi menempati satu gedung di sebelah timur wilayah SMKN 14 Bandung.  Gedung tersebut terdiri dua lantai dengan 5 ruang kelas dan satu ruang Guru Animasi. </strong></li>\n <li><strong>Kompetensi keahlian Animasi di SMKN 14 Bandung, saat ini memiliki tenaga guru sebanyak 6 orang.  Tiga diantaranya adalah ASN.  Mereka mengajar 11 mata pelajaran di kelompok C dari kelas X hingga kelas XII. Jumlah rombel Multimedia sebanyak 5 rombel dengan jumlah siswa 143 siswa. </strong></li>\n <li><strong>Ada pun DU/DI yang menjadi rekanan diantara nya adalah :  Cimahi Creative Association (CCA), BNN, Kumata Studio, UPT Learning ITB, PT. C59, Kebon Studio Animasi Yogyakarta, Nawarna Studio Animasi dan Nusa Edu</strong></li>\n</ul>\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030289.jpg', 'https://smkn14bdg.sch.id/upload/1609292945.png', '2020-01-09 03:12:25', '2021-09-19 00:00:00'),
(13, 'Multimedia', 'multimedia', '<p>Kompetensi Keahlian Multimedia pertama kali menjadi bagian SMKN 14 pada tahun 2004 di kelompok keahlian Teknologi Informasi dan Komputer.  Kompetensi keahlian Multimedia menempati satu gedung di sebelah timur.  Gedung tersebut terdiri dua lantai dengan 4 ruang kelas, satu ruang fotografi dan ruang guru MM.</p>\n\n<p>Kompetensi keahlian Multimedia saat ini memiliki tenaga guru sebanyak 10 orang.  Tiga diantaranya adalah ASN.  Mereka mengajar 11 mata pelajaran di kelompok C dari kelas X hingga kelas XII. Jumlah rombel Multimedia sebanyak 11 rombel dengan jumlah siswa 369 siswa. Ada pun DU/DI yang menjadi rekanan diantara nya adalah Jonas, PT. LEN, Telkom University, UPT Learning ITB, Humas Pemprov Jabar, Radio Dahlia, Radio Paramuda dan SEAMEO.</p>\n\n<p> </p>\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030145.jpg', 'https://smkn14bdg.sch.id/upload/1609292598.png', '2020-05-07 00:07:40', '2021-09-19 00:00:00'),
(6, 'Teknik Perbaikan Bodi Otomotif', 'teknik-perbaikan-bodi-otomotif', '<p>Tentang Teknik Perbaikan Bodi Otomotif...</p>\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030313.jpg', 'https://smkn14bdg.sch.id/upload/1609292902.png', '2020-01-09 03:13:12', '2021-09-19 00:00:00'),
(7, 'Kriya Kreatif Kayu dan Rotan', 'kriya-kreatif-kayu-dan-rotan', '<p>PROFIL DPK KAYU</p>\n\n<p>DEFINISI</p>\n\n<p>Desain dan Produksi Kria Kayu, menekankan pada keterampilan mendisain dan membuat karyadari bahan kayu pada tingkat menengah</p>\n\n<p>TUJUAN UMUM</p>\n\n<p>Menyiapkan peserta didik dengan keterampilan Desain dan Produksi Kria Kayu di tingkat tertentu</p>\n\n<p>TUJUAN KHUSUS</p>\n\n<p>Membekali peserta didik dengan keterampilan dasar-dasar ke kriaan, desain, Teknik Ukir, raut, Bubut, Scolling saw dan bekerja dengan menggunakan mesin dan finishing dengan tenik produksi tertentu</p>\n\n<p>FASILITAS</p>\n\n<p>RUANG PRAKTEK 15 M X 36 M TERDIRI DARI :</p>\n\n<p>A. RUANG INSTRUKTUR</p>\n\n<p>B. RUANG KARYA</p>\n\n<p>C. RUANG ALAT</p>\n\n<p>D. RUANG BAHAN</p>\n\n<p>E. TOILET</p>\n\n<p>F. AREA KERJA BANGKU/UKIR/RAUT/ FIINISHING</p>\n\n<p>G. AREA KERJA SCROLL</p>\n\n<p>H. AREA KERJA BUBUT</p>\n\n<p>I. AREA KERJA MESIN TETAP PERALATAN</p>\n\n<p>Ø ALAT KERJA BANGKU MANUAL Ø ALAT KERJA UKIR MASINAL Ø ALAT KERJA BUBUT Ø ALAT KERJA SCROLL Ø ALAT KERJA MESIN TETAP Ø ALAT KERJA FINISHING</p>\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030345.jpg', 'https://smkn14bdg.sch.id/upload/1609292851.png', '2020-01-09 03:14:07', '2021-09-19 00:00:00'),
(8, 'Kriya Kreatif Logam Dan Perhiasan', 'kriya-kreatif-logam-dan-perhiasan', '<p>Tentang Kriya Kreatif Logam Dan Perhiasan...</p>\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030381.jpg', 'https://smkn14bdg.sch.id/upload/1609292820.png', '2020-01-09 03:14:56', '2021-09-19 00:00:00'),
(9, 'Kriya Kreatif Kulit Dan Imitasi', 'kriya-kreatif-kulit-dan-imitasi', '<p>Kompetensi Keahlian Kriya Kulit dulu dikenal dengan sebuatan paket keahlian Desain<br>\ndan Produksi. paket keahlian Kriya Kulit (DP Kriya Kulit) lahir dan mulai dibuka pada<br>\nTahun Pelajaran 1996/1997. DP Kriya Kulit sampai tahun 2018 sudah meluluskan 20<br>\nangkatan/alumni.<br>\nPada perkembangan berikutnya DP Kriya Kulit dalam Kurikulum 2013 berdasarkan<br>\nPeraturan Direktur Jenderal Pendidikan Dasar dan Menengah Nomor<br>\n06/D.D5/KK/2018 tanggal 7 Juni 2018 tentang Spektrum Keahlian Sekolah Menengah<br>\nKejuruan (SMK)/ Madrasah Aliyah Kejuruan (MAK), mengalami perubahan istilah<br>\nnama jurusan. Perubahan tersebut sebagai berikut:<br>\nBidang Keahlian : Seni dan Industri Kreatif<br>\nProgram Keahlian : Desain dan Produk Kreatif Kriya<br>\nKompetensi Keahlian : Kriya Kreatif Kulit dan Imitasi<br>\n </p>\n', '', '<p><br>\n </p>\n', 'https://www.smkn14bdg.sch.id/upload/1632030410.jpg', 'https://smkn14bdg.sch.id/upload/1609292790.png', '2020-01-09 03:15:46', '2021-09-19 00:00:00'),
(10, 'Kriya Kreatif Batik Dan Tesktil', 'kriya-kreatif-batik-dan-tesktil', '<p>Tentang Kriya Kreatif Batik dan Tesktil...</p>\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030443.jpg', 'https://smkn14bdg.sch.id/upload/1609292757.png', '2020-01-09 03:16:23', '2021-09-19 00:00:00'),
(11, 'Kriya Kreatif Keramik', 'kriya-kreatif-keramik', '<p>Tentang Desain dan Produksi Kria Keramik...</p>\n', '', '', 'https://www.smkn14bdg.sch.id/upload/1632030476.jpg', 'https://smkn14bdg.sch.id/upload/1609292722.png', '2020-01-09 03:17:45', '2021-09-19 00:00:00');
