INSERT INTO `tbl_manajemen` (`id`, `id_jurusan`, `nama`, `nip`, `jabatan`, `matpel`, `deskripsi`, `image`, `created_at`, `updated_at`) VALUES
(27, 0, 'R. Dudi Rudiatna, S.Pd., S.ST., M.T.', '1970006082000031005', 1, '-', '<p>Assalamu ‘alaikum wa rahmatullahi wa barakatuh, SMKN 14 Kota Bandung adalah Sekolah Menengah Kejuruan yang memiliki bidang keahlian Seni Rupa, Kerajinan Kriya, TIK, serta Teknologi dan Rekayasa. SMKN 14 Kota Bandung Mempersiapkan lulusan yang berwawasan profesional, produktif, dan memiliki budaya kerja yang baik. Dengan Demikian SMKN 14 Kota Bandung siap menciptakan tamatan yang berkompeten sesuai dengan bidangnya.</p>\n', 'https://smkn14bdg.sch.id/upload/1611135034.jpg', '2020-01-09 03:21:21', '2020-01-09 03:21:21'),
