(158, 0, 'Jamirin, S.Pd', '', 2, '-', '<h1>Tata Usaha</h1>\r\n\r\n<p>Dalam rangka menunjang kelancaran proses belajar mengajar di instansi sekolah diperlukan suatu bagian yang mendukung kegiatan tersebut yaitu Ketatausahaan. Tata usaha adalah suatu bagian dari sekolah yang berfungsi sebagai pendukung kegiatan belajar mengajar agar berjalan lancar sesuai apa yang telah direncanakan dan bisa tercapai seperti apa yang diinginkan.</p>\r\n\r\n<p>Dengan berkembangnya zaman yang sekarang lebih dikenal dengan era globalisasi, fungsi tata usaha harus lebih dapat ditingkatkan kualitasnya tentang teknologi terutama teknologi informasi ataupun lebih dikenal dengan era komputerisasi. Hal ini dimaksud untuk lebih mengefektifkan pekerjaan dan untuk memberikan pelayanan yang lebih baik. Oleh karena itu setiap staf tata usaha diharuskan menguasai teknologi tersebut.</p>\r\n\r\n<p>Keberadaan ketatausahaan disetiap instansi sangat berperan penting untuk kelancaran kegiatan dan perkembangan instansi yang bersangkutan dan dengan perkembangan zaman teknologi informasi dapat lebih mengefektifkan kinerja dari tata usaha itu sendiri.</p>\r\n\r\n<p>Uraian Tugas Kepala Tata Usaha</p>\r\n\r\n<ol>\r\n <li>Menyusun program kerja Tata Usaha</li>\r\n <li>Mengkoordinir tugas-tugas tata usaha</li>\r\n <li>Membina dan mengembangkan tugas-tugas ketatausahaan.</li>\r\n <li>Mengatur pengurusan kepegawaian</li>\r\n <li>Meneliti dan kemudian membuat surat, baik surat masuk maupun surat keluar sesuai dengan disposisi/instruksi Kepala Sekolah.</li>\r\n <li>Memantau pelaksanakan 6K.</li>\r\n <li>Mengawasi dan mengendalikan penggunaan alat-alat sekolah</li>\r\n <li>Membantu Kepala sekolah dalam penyusunan E-RKAS</li>\r\n <li>Bertanggung jawab atas penggunaan stempel sekolah.</li>\r\n</ol>\r\n', 'https://www.smkn14bdg.sch.id/upload/1632048031.jpg', '2021-09-19 17:39:25', '2021-09-19 17:39:25'),
(239, 0, 'DEDI MUHAMAD KURNIADI, Drs.,SST.', '19640312 199103 1 006', 7, 'PEMINATAN DKV  ', '', 'https://www.smkn14bdg.sch.id/upload/1632107765.jpg', '2021-09-19 22:06:21', '2021-09-19 22:06:21'),
